import React from 'react';

function Home() {
  return (
    <div>
      <h2>Home Page</h2>
      <p>Welcome to the Home Page!</p>
      
      {/* Ajout des boutons "Start" et "Stop" */}
      <div className="button-container">
        <button className="btn-start">Start</button>
        <button className="btn-stop">Stop</button>
      </div>
    </div>
  );
}

export default Home;
